import React, { Component } from 'react'

class Table extends Component {
    render() {
        return (
            <div>
                <table>
                    <tr>
                        <td>Date</td>
                        <td>Description</td>
                        <td>Debit</td>
                        <td>Credit</td>
                        <td>Balance</td>
                    </tr>
                </table>
            </div>
        )
    }
}

export default Table
